import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'
import Topic from '../topic'
import Icon from './icon'

const Grid = styled.div`
  background: red;
  max-width: 500px;
  margin: auto;
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  grid-gap: 20px;
`

class Skill extends Component {
  render() {
    return (
      <FullScreen>
        <Topic>Skills</Topic>
        <Grid>
          <Icon percent={80} code={'\f5fc'} type={'solid'} />
          <Icon percent={80} code={'\f40e'} type={'regular'} />
          <Icon percent={40} code={'\f643'} type={'solid'} />
          <Icon percent={20} code={'\f085'} type={'solid'} />
        </Grid>
      </FullScreen>
    )
  }
}

export default Skill
